"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Ear tubes (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/ear-tubes-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1667279033\">",
"      <span class=\"h1\">",
"       What are ear tubes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Ear tubes are tiny tubes that a doctor puts in a child&rsquo;s eardrum to make an opening. The eardrum is the thin layer of tissue between the ear canal and the middle ear (",
"      <a class=\"graphic graphic_figure graphicRef55121 \" href=\"UTD.htm?29/61/30677\">",
"       figure 1",
"      </a>",
"      ). To put ear tubes in, doctors need to do surgery. Ear tubes are also sometimes called &ldquo;tympanostomy tubes&rdquo; or &ldquo;PE (short for &lsquo;pressure equalization&rsquo;) tubes.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279065\">",
"      <span class=\"h1\">",
"       Why might children get ear tubes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Children might get ear tubes if they:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Get a lot of ear infections &ndash; This includes children who get 3 or more ear infections in 6 months, or 4 or more infections in 1 year (",
"        <a class=\"graphic graphic_figure graphicRef54739 \" href=\"UTD.htm?26/44/27332\">",
"         figure 2",
"        </a>",
"        ). Ear tubes can help prevent children from getting more ear infections.",
"       </li>",
"       <li>",
"        Have fluid in the middle ear that won&rsquo;t go away &ndash; Ear tubes let the fluid drain out of the middle ear (the part of the ear behind the eardrum) (",
"        <a class=\"graphic graphic_figure graphicRef67163 \" href=\"UTD.htm?23/8/23680\">",
"         figure 3",
"        </a>",
"        ). This is helpful because fluid in the middle ear can cause hearing loss. Long-term hearing loss can lead to language and speech problems in children, especially in young children.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      There are other benefits of ear tubes, too. They:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Let air into the middle ear, which helps the middle ear heal",
"       </li>",
"       <li>",
"        Keep the pressure between the middle ear and the ear canal the same",
"       </li>",
"       <li>",
"        Can keep a growth of cells (called a &ldquo;cholesteatoma&rdquo;) from collecting in and damaging the middle ear",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279126\">",
"      <span class=\"h1\">",
"       What does ear tube surgery involve?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Before the surgery, your child&rsquo;s doctor will give you instructions about what to do. Children should not eat or drink for a certain number of hours before surgery.",
"     </p>",
"     <p>",
"      When the surgery starts, the doctor will give your child medicine to make him or her fall asleep. Then the doctor will make a small cut in the eardrum. He or she will place the ear tube in the eardrum.",
"     </p>",
"     <p>",
"      Most children can go home a few hours after surgery. They can usually do their normal activities the next day.",
"     </p>",
"     <p>",
"      After surgery, the doctor will see your child for a follow-up visit. The doctor will check that the tube is in the correct place and that fluid is draining well. He or she will also check your child&rsquo;s hearing. This might involve getting a hearing test.",
"     </p>",
"     <p>",
"      Your child&rsquo;s doctor will also tell you if you need to keep water out of your child&rsquo;s ear. He or she might recommend that your child wear ear plugs when swimming or bathing.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279141\">",
"      <span class=\"h1\">",
"       What problems can happen with ear tubes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The following problems can happen with ear tubes. They can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Keep draining &ndash; Sometimes, fluid or pus keeps draining out of the tube.",
"       </li>",
"       <li>",
"        Get blocked",
"       </li>",
"       <li>",
"        Move out of place and fall into the middle ear",
"       </li>",
"       <li>",
"        Fall out after only a short time",
"       </li>",
"       <li>",
"        Make a long-lasting hole in the eardrum",
"       </li>",
"       <li>",
"        Damage the eardrum tissue",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279156\">",
"      <span class=\"h1\">",
"       When should I call my child&rsquo;s doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After surgery, call your child&rsquo;s doctor or nurse if your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Gets a fever",
"       </li>",
"       <li>",
"        Has bloody drainage from the ear",
"       </li>",
"       <li>",
"        Has trouble hearing",
"       </li>",
"       <li>",
"        Has ear pain that doesn&rsquo;t get better or gets worse",
"       </li>",
"       <li>",
"        Is dizzy or falls down a lot",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279171\">",
"      <span class=\"h1\">",
"       How long do ear tubes stay in?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most ear tubes fall out on their own after 6 to 18 months. This is normal. If the ear tube doesn&rsquo;t fall out on its own after a few years, the doctor will probably do surgery to remove it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279186\">",
"      <span class=\"h1\">",
"       How can I decide if my child should get ear tubes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;This decision depends on your child and his or her individual situation. You should talk with your child&rsquo;s doctor about the benefits and downsides of ear tubes, and how much they can help your child.",
"     </p>",
"     <p>",
"      The decision will probably depend on:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        How old your child is",
"       </li>",
"       <li>",
"        How many ear infections he or she gets, or how long he or she has had fluid in the middle ear",
"       </li>",
"       <li>",
"        Whether your child has hearing loss",
"       </li>",
"       <li>",
"        Whether your child is talking",
"       </li>",
"       <li>",
"        Whether your child has other ear conditions",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1667279201\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
